import React from 'react'
import styled from 'styled-components'

function ListItem(props) {
    const {title, description, author, dateCreated, complete, dateComplete} = props;
  return (
    <Wrapper>
        <h1>{title}</h1>
        <p>{description}</p>
        <p>{author}</p>
        <p>{dateCreated}</p>
        <p>{complete}</p>
        <p>{dateComplete}</p>

    </Wrapper>
  )
}

export default ListItem

const Wrapper = styled.div`
    display: flex;
    flex-direction: column;
    border: solid black;
    margin: 15px
`
